import React, { useState } from "react";
import PropTypes from "prop-types";

const Fader = ({ text }) => {
  const [fadeProp, setFadeProp] = useState({
    fade: "animate-fadeIn",
  });
  return (
    <>
      <div>
        <h1> {text} </h1>
      </div>
    </>
  );
};

Fader.defaultProps = {
  text: "Hello, World!",
};

Fader.propTypes = {
  text: PropTypes.string,
};

export default Fader;
